import styled from 'styled-components'

export const HeaderSearchBar = styled.form`
  width: 70%;
`

export const HeaderSearchBarInput = styled.input`
  display: block;
  float: right;
  width: 60%;
  border-radius: 10px;
  padding: 10px;
  font-size: 16px;
`
